    "Cockpit had an unexpected internal error. <br/><br/>": [ null, "У Cockpit сталася неочікувана внутрішня помилка. <br/><br/>" ],
    "Cockpit is a server manager that makes it easy to administer your Linux servers via a web browser. Jumping between the terminal and the web tool is no problem. A service started via Cockpit can be stopped via the terminal. Likewise, if an error occurs in the terminal, it can be seen in the Cockpit journal interface.": [ null, "Cockpit — програма для керування сервером, яка полегшує адміністрування ваших серверів під керуванням Linux за допомогою програми для перегляду сторінок інтернету. Ви зможете одночасно використовувати термінал і вебінструмент. Службу, яку було запущено за допомогою Cockpit, можна зупинити за допомогою термінала. І навпаки, якщо трапиться помилка у терміналі, ви побачите її у інтерфейсі журналу Cockpit." ],
    "Cockpit is not compatible with the software on the system.": [ null, "Cockpit є несумісним із програмним забезпеченням цієї системи." ],
